script: |
  super -f text -I q7354.spq | sort > q7354.out

inputs:
  - name: q7354.spq
    data: |
      SELECT + col1 + + 91 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - 49 * - col0 BETWEEN 93 * - col0 AND col1;
  - name: tab2

outputs:
  - name: q7354.out
    data: |
      142
      158
      168
